python-tornado.html.body:
启动方式
cd到项目目录

python3 -m venv venv

进入venv环境

. venv/bin/active

安装tornado

pip3 install tornado

启动

python server.py

进入venv后的自动重启（不设置settings里的autoreload）

python -m tornado.autoreload server.py

部署使用supervisor+nginx
使用supervisor支持python3
supervisor配置
; 设置进程的名称，使用 supervisorctl 来管理进程时需要使用该进程名
[program:tornado_dir_struct]
environment=PYTHONPATH='/usr/local/lib/python3.7/site-packages/'
directory=/Users/victor/myProj/python-tornado/dir-struct  ; 执行 command 之前，先切>    换到工作目录
command=python3 server.py
;numprocs=1                 ; 默认为1
;process_name=%(program_name)s   ; 默认为 %(program_name)s，即 [program:x] 中的 x
;user=oxygen                 ; 使用 oxygen 用户来启动该进程
; 程序崩溃时自动重启，重启次数是有限制的，默认为3次
autorestart=true
redirect_stderr=true        ; 重定向输出的日志
stdout_logfile = /var/log/supervisord/tornado_server.log
loglevel=info

nginx配置
参考
upstream tornado_py {
    server 127.0.0.1:9010;
}

server {
    server_name tornado.bnv.com;
    listen 80;

    location / {
        proxy_pass_header Server;
        proxy_set_header Host $http_host;
        proxy_set_header X-Real-IP $remote_addr;
        proxy_set_header X-Scheme $scheme;
        proxy_pass http://tornado_py;
    }
}

python-uwsgi.html.body:
uwsgi官方文档

参考

使用nginx + uwsgi socket的方式来部署Django项目
uwsgi使用介绍
uwsgi ini 配置

不用ini文件
http启动方式

uwsgi --http :9796 --wsgi-file app.py

该命令启动成功后可以直接通过http://127.0.0.1:9796访问



配置到nginx
server {
    server_name py.bnv.com;
    listen 80;

    location / {
        proxy_pass http://127.0.0.1:9796; # 直接通过代理的方式
    }
}

socket启动方式

uwsgi --socket :9796 --wsgi-file app.py

socket启动方式还要配置nginx
upstream uwsgi_py {
    server 127.0.0.1:9796;
}

server {
    server_name py.bnv.com;
    listen 80;

    location /{
        include uwsgi_params;
        uwsgi_pass uwsgi_py; # socket方式
    }
}

或者
server {
    server_name py.bnv.com;
    listen 80;

    location /{
        include uwsgi_params;
        uwsgi_pass 127.0.0.1:9796; # socket方式
    }
}

uwsgi_params文件：
uwsgi_param  QUERY_STRING       $query_string;
uwsgi_param  REQUEST_METHOD     $request_method;
uwsgi_param  CONTENT_TYPE       $content_type;
uwsgi_param  CONTENT_LENGTH     $content_length;

uwsgi_param  REQUEST_URI        $request_uri;
uwsgi_param  PATH_INFO          $document_uri;
uwsgi_param  DOCUMENT_ROOT      $document_root;
uwsgi_param  SERVER_PROTOCOL    $server_protocol;
uwsgi_param  HTTPS              $https if_not_empty;

uwsgi_param  REMOTE_ADDR        $remote_addr;
uwsgi_param  REMOTE_PORT        $remote_port;
uwsgi_param  SERVER_PORT        $server_port;
uwsgi_param  SERVER_NAME        $server_name;
使用ini文件

uwsgi --ini uwsgi.ini

[uwsgi]
#http = 0.0.0.0:9796
socket = 0.0.0.0:9000
wsgi-file = ./server.py


http通过ip可以直接访问，socket要配置ng
要注意ng权限，如果不是管理员则启动时要加上sudo


更多的详细请参考官方文档

重启 uwsgi --reload uwsgi.pid
关闭 uwsgi --stop uwsgi.pid
停止所有 sudo pkill -f uwsgi -9

ini文件里设置pidfile，通过该pid文件可以控制uwsgi的重启和停止
chdir=/xxx/   #当前项目的绝对路径
pidfile=%(chdir)/uwsgi/uwsgi.pid
stats=%(chdir)/uwsgi/uwsgi.status
实时动态查看状态 - uwsgitop
pip3 install uwsgitop
uwsgitop uwsgi/uwsgi.status

